range = [1:2:1000];times = [];timesBruteForce = []for i = range    tic();  isLucky(i);  times = [times, toc()];    tic();  isLuckyAlternative(i);  timesBruteForce = [timesBruteForce, toc()];  
endforplot(range, times .* 1000);  hold on;plot(range, timesBruteForce .* 1000);set(gca,'FontSize',15);set(gca,'YTick',0:0.4:1.6)xlabel('Input x');ylabel('Execution Time (ms)');legend({'isLucky', 'LuckyAlternative'});print -depsc ../report/islucky_test.epshold off;